import React from 'react';
import '../css/admin.css';

function Home(props){
    return(
        <div>
            <h1>Admin Panel</h1>
            <button onClick={() => props.history.push('/admin/add')}>Add</button><br/>
            <button>Modify</button>
        </div>
    );
}

export default Home;
